% ==========================================================
%  SHORT-TERM WIND POWER FORECASTING
%  VERIFIED & CORRECT VERSION
%% ==========================================================

clc;
clear;

data = readtable('wind_data.csv');

% Read columns by POSITION (not by name)
windSpeed = data{:,1};   % First column
power     = data{:,2};   % Second column

% Remove NaN if any
validIdx  = ~isnan(windSpeed) & ~isnan(power);
windSpeed = windSpeed(validIdx);
power     = power(validIdx);


%% ===============================
% 2. NORMALIZATION
% ===============================
pmin = min(power);
pmax = max(power);
power_n = (power - pmin) / (pmax - pmin);

%% ===============================
% 3. TRAIN–TEST SPLIT (80–20)
% ===============================
N = length(power_n);
trainN = floor(0.8 * N);

trainData = power_n(1:trainN);
testData  = power_n(trainN+1:end);

%% ===============================
% 4. ARIMA MODEL (CORRECT)
% ===============================
% ===============================
% MANUAL AR MODEL (NO TOOLBOX)
% ===============================

p = 5;   % AR order

Y = trainData;
Ntr = length(Y);

X = zeros(Ntr-p, p);
for i = 1:p
    X(:,i) = Y(p+1-i:Ntr-i);
end

Y_target = Y(p+1:end);

% Train AR model
AR_coeff = X \ Y_target;

% Predict on training data
Y_AR_train = X * AR_coeff;

%% ===============================
% 5. PREPARE GRU DATA (SLIDING WINDOW)
% ===============================
% ===============================
% GRU DATA PREPARATION
% ===============================
window = 10;

XTrain = cell(length(trainData)-window,1);
YTrain = zeros(length(trainData)-window,1);

for i = 1:length(trainData)-window
    XTrain{i} = trainData(i:i+window-1)';   % CELL
    YTrain(i) = trainData(i+window);        % DOUBLE
end

XTest = cell(length(testData)-window,1);
YTest = zeros(length(testData)-window,1);

for i = 1:length(testData)-window
    XTest{i} = testData(i:i+window-1)';     % CELL
    YTest(i) = testData(i+window);          % DOUBLE
end


%% ===============================
% 6. GRU MODEL (CORRECT)
% ===============================
disp('Training GRU model...'); %[output:93a975ad]

layers = [
    sequenceInputLayer(1)
    gruLayer(50,'OutputMode','last')
    fullyConnectedLayer(1)
    regressionLayer
];

options = trainingOptions('adam', ...
    'MaxEpochs',150, ...
    'MiniBatchSize',16, ...
    'InitialLearnRate',0.003, ...
    'GradientThreshold',1, ...
    'Verbose',0);

netGRU = trainNetwork(XTrain, YTrain, layers, options);

YPred_GRU = predict(netGRU, XTest);
YPred_GRU = predict(netGRU, XTest);


%% ===============================
% 7. HYBRID ARIMA + GRU (CORRECT)
% ===============================
disp('Training Hybrid ARIMA-GRU model...'); %[output:838d32be]

% Sliding window on ARIMA residuals
%% ===============================
% GRU PREDICTION (FINAL MODEL)
%% ===============================

YPred_GRU = predict(netGRU, XTest);

YTest_final = YTest(window+1:end)';

%% ===============================
% 8. PERFORMANCE METRICS
% ===============================

% ---- GRU ----
MAE_GRU  = mean(abs(YTest_final - YPred_GRU(window+1:end)));
RMSE_GRU = sqrt(mean((YTest_final - YPred_GRU(window+1:end)).^2));
R2_GRU   = 1 - sum((YTest_final - YPred_GRU(window+1:end)).^2) / ...
               sum((YTest_final - mean(YTest_final)).^2);


%% ===============================
% 9. DISPLAY RESULTS
% ===============================
fprintf('\n===== MODEL PERFORMANCE =====\n'); %[output:89e658d5]
fprintf('GRU    -> MAE: %.4f | RMSE: %.4f | R2: %.4f\n', MAE_GRU, RMSE_GRU, R2_GRU); %[output:01b3c9db]

%% ===============================
% 10. PLOTS
% ===============================
figure; %[output:176af74d]
plot(YTest_final,'k','LineWidth',1.2); hold on; %[output:176af74d]
plot(YPred_GRU(window+1:end),'b'); %[output:176af74d]
legend('Actual','GRU'); %[output:176af74d]
title('Wind Power Forecasting (Verified Model)'); %[output:176af74d]
xlabel('Samples'); %[output:176af74d]
ylabel('Normalized Power'); %[output:176af74d]
grid on; %[output:176af74d]


